"Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR)=/Dastaklovchi marja. UniMMR bu - pozitsiya xavfini nazorat qilishda ishlatiladigan nisbatdir.

Normal: Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) > 2, savdo normal;

Minimal xavf: 1,5 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 2, savdo normal, lekin potentsial Likvidatsiyaga eʼtibor berish kerak;

Oʻrtacha xavf: 1,2 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1,5, savdo normal, lekin Likvidatsiyani oldini olish uchun koʻproq Mablagʻ qoʻshish kerak;

Yuqori xavf: 1,1 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1,2, savdo cheklangan, savdo qilish mumkin emas, olib qoʻyish mumkin va faqat chegirmali savdoni joylashtirishi mumkin;

Tugatilgan: 1 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1,05, Likvidatsiya ishga tushirildi.

Bankrot: Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1, bankrot."

"Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) /Dastaklovchi marja.
Sizning tuzatilgan kapitalingiz (USD) = %1$s
Sizning xizmat ko'rsatish marjangiz (USD) = %2$s

UniMMR - bu pozitsiya xavfini nazorat qilish uchun foydalanadigan nisbat.

Oddiy: Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) > 2, oddiy savdo;

Minimum Risk: 1,5 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 2, odatdagidek savdo, lekin potentsial likvidatsiyaga eʼtibor berish kerak;

Oʻrtacha risk: 1,2 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1,5, odatdagidek savdo, lekin likvidatsiyadan qochish uchun koʻproq mablagʻ kerak;

Yuqori xavf: 1,1 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1,2, savdo cheklangan, savdo qilish mumkin emas, olib qoʻyish va faqat qisqartirilgan savdoni amalga oshirish mumkin;

Likvidatsiya: 1 < Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1,05, likvidatsiya ishga tushirildi.

Bankrot: Marjani dastaklovchi birlashgan koeffitsiyent (uniMMR) <= 1, bankrot."
